import { Component, OnInit, Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Router } from '@angular/router';
import { UserService } from '../api/user-service';


@Component({
  selector: 'login-tacocloud',
  templateUrl: 'login.component.html',
  styleUrls: ['./login.component.css']
})

export class LoginComponent implements OnInit {

  singInModel = {
    username: '',
    password: '',
  };

  regitrationModel = {
    username: '',
    password: '',
    verifyPassword: '',
    fullName: '', // Add this line
    street: '',
    city: '', // Remove ".formField" from here
    state: '',
    zip: '',
    phone: '',
};


  constructor(private httpClient: HttpClient, private router: Router, private userService: UserService) { }

  ngOnInit() { }

  onRegisterSubmit() {
      this.httpClient.post(
        'http://localhost:8080/register',
        this.regitrationModel,
        {
          headers: new HttpHeaders().set('Content-type', 'application/json')
                      .set('Accept', 'application/json'),
          observe: 'response'
        }
      ).subscribe(response => {
        if (response.status  === 201) {
          // 페이지를 다시 로드하는 코드
          alert('등록이 완료되었습니다.');
          this.router.navigate(['/ui/login']);
        } else {
          // 다른 상황에 대한 처리
        }
      });
  }

  onSignIn() {
    this.httpClient.post(
      'http://localhost:8080/customLogin',
      this.singInModel,
      {
        headers: new HttpHeaders().set('Content-type', 'application/json')
                    .set('Accept', 'application/json'),
        observe: 'response'
      }
    ).subscribe((response: any) => {
      if (response.status === 200) {
        alert("로그인 성공");

        const user = response.body; // User 객체
        console.log(user);
        
        sessionStorage.setItem('user', JSON.stringify(user));

        this.userService.updateUser(user);
        this.router.navigateByUrl('/').then(() => {
          window.location.reload();
        });
      } else {
        console.log(response); // 응답 객체 로그로 출력
        alert("로그인 실패");
      }
    });
  }
}
<cloud-title>Sign in to Taco Cloud</cloud-title>

<p style="font-weight: bold; color: red;">
  The sign in and security features of this version of Taco Cloud are not
  yet implemented. The forms presented below do absolutely nothing...yet.
  Stay tuned.
</p>

<group-box title="Sign in">
  <form (ngSubmit)="onSignIn()">
    <label for="username"><b>Username:</b></label><br/>
    <input type="text" [(ngModel)]="singInModel.username" name="username" class="formField"/><br/>
    <label for="password"><b>Password:</b></label><br/>
    <input type="password" [(ngModel)]="singInModel.password" name="password" class="formField"/><br/><br/>
    <!-- <big-button label="Sign in"></big-button> -->
    <input type="submit" value="Sing in"/>
  </form>
</group-box>

<group-box title="Register">
  <form (ngSubmit)="onRegisterSubmit()">
    <label for="username"><b>Username:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.username" name="username" class="formField"/><br/>
    <label for="password"><b>Password:</b></label><br/>

    <input type="password" [(ngModel)]="regitrationModel.password" name="password" class="formField"/><br/><br/>
    <label for="password"><b>(verify password)</b></label><br/>

    <input type="password" [(ngModel)]="regitrationModel.verifyPassword" name="verifyPassword" class="formField"/><br/><br/>

    <label for="fullName"><b>Full name:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.fullName" name="fullName" class="formField"/><br/><br/>

    <label for="street"><b>Street:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.street" name="street" class="formField"/><br/><br/>

    <label for="city"><b>City / State:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.city" name="city" class="formField"/>
    <input type="text" [(ngModel)]="regitrationModel.state" name="state" class="formField"/><br/><br/>

    <label for="zipCode"><b>Zip code:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.zip" size="2" name="zip" class="formField"/><br/><br/>

    <label for="phoneNumber"><b>Phone number:</b></label><br/>
    <input type="text" [(ngModel)]="regitrationModel.phone" name="phoneNumber" class="formField"/><br/><br/>

    <!-- <big-button label="Submit Register" (clickEvent)="onSubmit()"></big-button> -->
    <input type="submit" value="Register"/>
  </form>
</group-box>
